COPY public."Class" (id, "moduleId", description, "createdAt", "updatedAt", "videoUrl", "imageUrl", title) FROM stdin;
a1b2c3d4-e5f6-7890-a1b2-c3d4e5f67891	c1a2b3d4-e5f6-7890-a1b2-c3d4e5f67890	Esta clase explora en detalle la historia de la dermatología, sus orígenes y los hitos más relevantes que impulsaron el desarrollo de esta especialidad médica. Abarca los primeros descubrimientos y el papel fundamental de diversos especialistas que, a lo largo del tiempo, han contribuido al conocimiento de la piel y sus patologías.	2024-12-27 14:37:09.348	2025-03-30 01:31:28.502	https://res.cloudinary.com/dwcrzwawj/video/upload/v1732284861/samples/elephants.mp4	https://res.cloudinary.com/dwcrzwawj/image/upload/v1733414008/courses/course-main-image/owottark15vkcnp3po2h.png	Historia de la Dermatología
b2c3d4e5-f6e7-8901-b2c3-d4e5f67890a2	c1a2b3d4-e5f6-7890-a1b2-c3d4e5f67890	En esta clase se profundiza en la relevancia de la dermatología dentro del contexto general de la medicina. Se discuten sus múltiples interacciones con otras especialidades, los motivos por los cuales es esencial para el diagnóstico integral y la importancia de la prevención, el cuidado de la piel y la educación del paciente.	2024-12-27 14:37:09.348	2025-03-30 01:31:28.502	\N	https://res.cloudinary.com/dwcrzwawj/image/upload/v1733414007/courses/course-main-image/qqhwsaebibwb0frsk1go.jpg	Importancia de la Dermatología en la Medicina
c3d4e5f6-e7f8-9012-c3d4-e5f67890a3b4	d2a3b4c5-e6f7-8901-b2c3-d4e5f67890a1	Esta clase describe detalladamente la anatomía y la fisiología de la piel. Se revisan las distintas capas —epidermis, dermis e hipodermis—, su composición celular y las funciones que desempeñan en la protección del organismo, así como los mecanismos de renovación y regeneración cutánea.	2024-12-27 14:37:09.348	2025-03-30 01:31:28.502	\N	https://res.cloudinary.com/dwcrzwawj/image/upload/v1733414008/courses/course-main-image/owottark15vkcnp3po2h.png	Estructura de la Piel
d4e5f6e7-f8e9-0123-d4e5-f67890a3b4c5	d2a3b4c5-e6f7-8901-b2c3-d4e5f67890a1	En esta clase se abordan las diversas funciones que cumple la piel: protección contra agentes externos, termorregulación, sensación táctil y respuesta inmunológica. Además, se discute cómo cada función se ve afectada ante alteraciones dermatológicas y qué implicaciones tiene en la salud en general.	2024-12-27 14:37:09.348	2025-03-30 01:31:28.502	\N	https://res.cloudinary.com/dwcrzwawj/image/upload/v1733414007/courses/course-main-image/qqhwsaebibwb0frsk1go.jpg	Funciones de la Piel
e5f6e7f8-9012-3456-d4e5-f67890a4c5d6	e3a4b5c6-f7e8-9012-c3d4-e5f67890a1b2	La clase profundiza en las causas, síntomas y tratamientos de la dermatitis atópica, un trastorno inflamatorio crónico de la piel. Se revisa su base genética e inmunológica, la relación con factores ambientales, así como las recomendaciones para el manejo integral y la mejoría de la calidad de vida del paciente.	2024-12-27 14:37:09.348	2025-03-30 01:31:28.502	\N	https://res.cloudinary.com/dwcrzwawj/image/upload/v1733414008/courses/course-main-image/owottark15vkcnp3po2h.png	Dermatitis Atópica
f6e7f890-1234-5678-e5f6-7890a5c6d7e8	e3a4b5c6-f7e8-9012-c3d4-e5f67890a1b2	Esta clase se centra en la patogénesis y manifestaciones clínicas de la psoriasis, una enfermedad autoinmune que afecta principalmente la piel y puede tener repercusiones sistémicas. Se analizan sus diferentes presentaciones clínicas, los tratamientos actuales, y la importancia de una atención multidisciplinaria.	2024-12-27 14:37:09.348	2025-03-30 01:31:28.502	\N	https://res.cloudinary.com/dwcrzwawj/image/upload/v1733414007/courses/course-main-image/qqhwsaebibwb0frsk1go.jpg	Psoriasis
\.
