cm90knoje0001key4ifffjbh6	cm4sths4i0008g1865nsbbh1l	b2c3d4e5-f6e7-8901-b2c3-d4e5f67890a2	\N	 Me gustaría entender mejor cómo los dermatólogos colaboran con otras especialidades médicas. ¿Podría dar un ejemplo de un caso en el que una consulta dermatológica haya sido clave para el diagnóstico de una enfermedad más compleja?	2025-04-02 23:42:28.346	2025-04-02 23:42:28.346
cm90kq18i0003key4ozxm1q5c	cm4sths4i0008g1865nsbbh1l	b2c3d4e5-f6e7-8901-b2c3-d4e5f67890a2	cm90knoje0001key4ifffjbh6	¡Excelente pregunta! Un ejemplo común es la detección de diabetes a través de signos en la piel, como la acantosis nigricans, que se manifiesta con manchas oscuras en los pliegues. Otro caso es el lupus, donde las lesiones cutáneas pueden ser la primera señal de la enfermedad. En estos casos, el dermatólogo juega un papel crucial en la derivación temprana del paciente para un tratamiento adecuado.	2025-04-02 23:44:18.115	2025-04-02 23:44:18.115
